import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom'
import _ from 'lodash'


const MobileList = ({ mobiles, handleDelete }) => {
  // const dispatch = useDispatch()
  const [posts, setPosts] = useState([])

  const fetchUsers = async () => {
      const response = await axios.get("https://jsonplaceholder.typicode.com/users")
         setPosts(response.data)
  }
useEffect(() => {
  fetchUsers()
}, [])
  return (
    <div>
      {/* isEmpty  use in lodash */}
      {!_.isEmpty(mobiles) ? (
        <table>
          <thead>
            <tr>
              <th>Model</th>
              <th>Brand</th>
              <th>Price</th>
              <th>spec</th>
            </tr>
          </thead>
          <tbody>
            {/* map function use to ladash method */}
            {_.map(mobiles, (item) => (
              <tr key={item.id}>
                <td>{item.model}</td>
                <td>{item.brand}</td>
                <td>{item.price}</td>
                <td>{item.spec}</td>
                <td>
                  <span> <button onClick={() => handleDelete(item.id)}>Delete</button></span>
                  <span> <Link to={`edit/${item.id}`}><button>Edit
                  </button></Link></span>
                </td>
              </tr>
            ))}
          </tbody>
        </table>) : (
        <p>List is Empty</p>
      )}
      <h3>List userList</h3>
      {posts.map((postList,index)=>(
        <ul key={"postList" + index}>
          <li>{postList}</li>
        </ul>
      ))}
    </div>
  )
}


export default MobileList
